INSERT INTO `work_note` VALUES (1,'组织生活会、组织生活和主题党日的区别','劳马东','2019-05-15 18:47:10.764990','2019-05-15 18:47:10.765017','<p><img src=\"/media/note/images/日常党务须知_20190515184653_495.png\" style=\"width: 874px; height: 481px;\" width=\"874\" height=\"481\"/></p><p><img src=\"/media/note/images/日常党务须知2_20190515184653_431.png\" style=\"width: 873px; height: 472px;\" width=\"873\" height=\"472\"/></p><p><br/></p>','',85),(2,'2019年5月预备党员转正（预审前）','劳马东','2019-05-15 18:51:40.135549','2019-05-15 18:51:40.135576','<h1><span style=\"font-family:宋体\">彭博东和刘展宏同学转正预审工作安排（</span>2019.5<span style=\"font-family:宋体\">）</span></h1><p class=\"MsoListParagraph\" style=\"margin-left:24px\">1、 <span style=\"font-family:宋体\">转正申请书（</span>&gt;1000<span style=\"font-family:宋体\">）：已经收到</span></p><p class=\"MsoListParagraph\" style=\"margin-left:24px\">2、 <span style=\"font-family:宋体\">出具一份成绩单（至转正前）</span> <span style=\"font-family:宋体\">（</span>2019-05-09 22:00<span style=\"font-family:宋体\">前提交）</span></p><p class=\"MsoListParagraph\" style=\"margin-left:24px\">3、 <span style=\"font-family:宋体\">填写《预备党员考察登记表》</span></p><p class=\"MsoListParagraph\" style=\"margin-left:56px\">1)<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">本人思想、学习、工作情况（</span>2019-05-09 22:00<span style=\"font-family:宋体\">前完成）</span></p><p class=\"MsoListParagraph\" style=\"margin-left:56px;text-indent:0\"><span style=\"font-family:宋体\">摘抄季度思想汇报的内容。</span></p><p class=\"MsoListParagraph\" style=\"margin-left:84px\">A.<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">第一季度（</span>2018.6-2018-9<span style=\"font-family:宋体\">）</span></p><p class=\"MsoListParagraph\" style=\"margin-left:84px\">B.<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">第二季度（</span>2018.9-2018-12<span style=\"font-family:宋体\">）</span></p><p class=\"MsoListParagraph\" style=\"margin-left:84px\">C.<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">第三季度（</span>2018.12-2018-3<span style=\"font-family:宋体\">）</span></p><p class=\"MsoListParagraph\" style=\"margin-left:84px\">D.<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">第四季度（</span>2018.3-2018-5<span style=\"font-family:宋体\">）</span></p><p class=\"MsoListParagraph\" style=\"margin-left:56px\">2)<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">入党介绍人考察情况和</span>P9<span style=\"font-family: 宋体\">入党介绍人意见（</span>2019-05-10<span style=\"font-family:宋体\">前完成）</span></p><p class=\"MsoListParagraph\" style=\"margin-left:56px\">3)<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">党支部考察情况（</span>2019-05-11<span style=\"font-family:宋体\">前完成）</span></p><p class=\"MsoListParagraph\" style=\"margin-left:24px\">4、 <span style=\"font-family:宋体\">征求党小组和群众意见</span></p><p class=\"MsoListParagraph\" style=\"margin-left:56px\">1)<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">召集</span>6-8<span style=\"font-family:宋体\">名预备党员本人关系紧密的群众以听取意见，并如实记录至《材料</span>23<span style=\"font-family:宋体\">：拟转正预备党员民主评议意见<span style=\"color:red\">原始记录</span>表》，意见可打印，签名和日期手写（</span>2019-05-09 22:00<span style=\"font-family:宋体\">前提交）</span></p><p class=\"MsoListParagraph\" style=\"margin-left:56px\">2)<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">填写《预备党员考察登记表》</span>P9<span style=\"font-family:宋体\">“党小组、群众意见”的<span style=\"color:red\">综合</span>意见。（</span>2019-05-11<span style=\"font-family:宋体\">前完成）</span></p><p class=\"MsoListParagraph\" style=\"margin-left:24px\">5、 <span style=\"font-family:宋体\">公示（</span>2019-05-11<span style=\"font-family:宋体\">到</span>2019-05-15<span style=\"font-family: 宋体\">）</span></p><p class=\"MsoListParagraph\" style=\"margin-left:24px;text-indent:0\"><span style=\"font-family:宋体\">《材料</span>24<span style=\"font-family:宋体\">：近期拟转正预备党员名单公示（</span> <span style=\"font-family:宋体\">年</span>&nbsp; <span style=\"font-family:宋体\">月</span>&nbsp; <span style=\"font-family:宋体\">日）》</span></p><p class=\"MsoListParagraph\" style=\"margin-left:24px;text-indent:0\"><span style=\"font-family:宋体\">《材料</span>25<span style=\"font-family:宋体\">：关于近期拟转正预备党员公示报告》，纸质版，一人一份</span></p><p class=\"MsoListParagraph\" style=\"margin-left:24px\">6、 <span style=\"font-family:宋体\">党支部审查（</span>2019-05-16<span style=\"font-family:宋体\">）</span></p><p style=\"margin-left:24px\"><span style=\"font-family:宋体\">完成《中国共产党预备党员考察登记表》中转正前预审相关内容栏目，填写《拟转正预备党员名单汇总预审表》。</span></p><p>&nbsp;</p><p>&nbsp;</p><h1><span style=\"font-family:宋体\">材料清单：</span></h1><p>1.&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"font-family:宋体\">转正申请书（</span>1000<span style=\"font-family:宋体\">字以上）。</span></p><p>2.&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"font-family:宋体\">《中国共产党预备党员考察登记表》填写至党支部意见一栏。</span></p><p>3.&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"font-family:宋体\">《材料</span>23<span style=\"font-family:宋体\">：拟转正预备党员民主评议意见原始记录表》纸质版，一人一份。</span></p><p>4.&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"font-family:宋体\">《材料</span>25<span style=\"font-family:宋体\">：关于近期拟转正预备党员公示报告》，纸质版，一人一份。</span></p><p>5.&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"font-family:宋体\">《材料</span>26<span style=\"font-family:宋体\">：申请转正预备党员名单汇总预审表》电子版，一支部一份，发到党建邮箱</span>sdcsxsdj1111@qq.com<span style=\"font-family:宋体\">中。</span></p><p>6.&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"font-family:宋体\">学业成绩单（至转正前，可复印）</span></p><p><br/></p>','工作笔记/计算机本科生第二党支部/关于下发预备党员转正的通知预审前.docx',85);
